import React from "react";

export default function Header() {
  return (
    <div>
      <h1>Hello from !!</h1>
      <input
        className="searchbar"
        type="textbox"
        name="searchbar"
        placeholder="Search"
      ></input>
      <input
        className="header__button"
        type="button"
        name="upload"
        value="UPLOAD"
      ></input>
    </div>
  );
}
